import React from "react";
import {Container,Row,Button} from 'reactstrap';
import { NavLink,Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const nav_links=[
    {
        path:'/home'  ,
        display:'Home'

    },
    {
        path:'#'  ,
        display:'About'

    },
    {
        path:'/tours'  ,
        display:'Tours'

    },
   

    
]

const Header = () =>{
    return <header className="header">
        <Container>
            <Row>
                <div className="nav_wrapper d-flex align-items-center justify-content-between"div>

                    {/*==========logo==========*/}
                    <div className="logo">
                        <img src={logo} alt=""/>
                        </div>

                    {/*==========End==========*/}
                    {/*=========Menu start ==========*/}
                    <div className="Navigation">
                        <ul className="Menu d-flex align-items-center gap-5">
                            {
                                nav_links.map((item,index)=>(
                                    <li className="nav_item" key={index}>
                                        <NavLink to={item.path}>{item.display}
                                        </NavLink>
                                    </li>
                                ))
                            }
                        </ul>
                    </div>
                    {/*==========Menu End==========*/}
                    <div className="nav_right d-flex align-items-center gap-4"></div>
                    <div className="nav_btns d-flex align-items-center gap-4"></div>
                    <button className="btn secondary_btn"><Link to='/Login'>Login</Link></button>
                    <button className="btn primary_btn"><Link to='/Register'></Link></button>
                    </div>
                    <span className="mobile_menu">
                    <i class="ri-menu-line"></i>
                    </span>
            </Row>
        </Container>
        </header>
};

export default Header;
